    "message": "{\"id\":2,\"title\":\"مقياس اضطراب القلق العام \",\"color\":\"#13C16D\",\"icon\":\"https://talbinahtest.s3.eu-central-1.amazonaws.com/MentalAssessment/Anxiety.png\",\"question_number\":7,\"duration\":3,\"answer_type\":\"word\",\"total_grade\":21,\"reference\":\"الاستبيان الصحي في عينة سعودية. آن جين الطب النفسي\",\"brief\":\"يشكل هذا الاستبيان جزءا مهما من عملية تقديم افضل رعاية صحية ممكننة لك وستساعد اجابتك فى فهم المشكلات التى قد تعانى منها الرجاء الاجابه عن كل سؤال ب اكبر قدر من الصراحه\",\"usage_count\":329,\"created_at\":\"2023-12-28T06:43:53.000000Z\",\"updated_at\":\"2025-06-12T23:44:05.000000Z\"}",
