    "isMessageOpened": "1",
    "message": "{\"id\":26,\"article_category\":null,\"keywords\":null,\"title\":\"الوسواس القهري\",\"description\":\"<h1><font color=\\\"#083139\\\"><span style=\\\"font-weight: 600;\\\">الفرق بين اضطراب الوسواس القهري واضطراب الشخصية الوسواسية</span></font></h1><p>في هذا المقال، سنبحث في الفروقات الأساسية بين اضطراب الوسواس القهري (OCD) واضطراب الشخصية الوسواسية (OCPD)، وهما حالتان نفسيتان تبدوان متشابهتين من خلال التسمية وبعض السلوكيات، لكنهما تختلفان جوهريًا في الأسباب، الأعراض، وطرق العلاج.</p><h3><font color=\\\"#003163\\\"><span style=\\\"font-weight: 600;\\\">اضطراب الوسواس القهري (OCD)</span></font></h3><p>اضطراب الوسواس القهري هو اضطراب القلق الذي يتميز بوجود أفكار متكررة وغير مرغوب فيها (وساوس) تسبب القلق أو الانزعاج. الأشخاص المصابون بـOCD يحاولون التخلص من هذه الأفكار أو تقليل قلقهم من خلال تنفيذ سلوكيات معينة بشكل متكرر (قهريات).</p><h4><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">الأعراض الرئيسية لـOCD:</font></span></h4><ul><li>وجود وساوس تسبب القلق الشديد.</li><li>تنفيذ قهريات لتخفيف هذا القلق، مثل غسل اليدين بشكل مفرط أو التحقق المتكرر من الأشياء.</li><li>السلوكيات القهرية تستهلك وقتًا كبيرًا وتعيق الأداء اليومي.</li></ul><h3><font color=\\\"#003163\\\"><span style=\\\"font-weight: 600;\\\">اضطراب الشخصية الوسواسية (OCPD)</span></font></h3><p>اضطراب الشخصية الوسواسية هو اضطراب الشخصية الذي يتميز بالحرص الشديد على النظام، الكمال، والسيطرة، إلى الحد الذي يمكن أن يعيق الكفاءة والمرونة. الأشخاص المصابون بـOCPD غالبًا ما يكونون متمسكين بشدة بقواعد وجداول زمنية، ولديهم معايير عالية لأنفسهم وللآخرين.</p><h4><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">الأعراض الرئيسية لـOCPD:</font></span></h4><ul><li>الإفراط في الانشغال بالتفاصيل، القواعد، والقوائم إلى الحد الذي يفقد فيه الهدف الرئيسي.</li><li>كونهم متصلبين وعنيدين.</li><li>التقتير في الإنفاق لأنفسهم وللآخرين لأنهم يرونه كشكل من أشكال الادخار للكوارث المستقبلية.</li></ul><h3><span style=\\\"font-weight: 600;\\\"><font color=\\\"#083139\\\">الفروق الأساسية</font></span></h3><ol><li><p><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">الأسباب والدوافع:</font></span></p><ul><li><span style=\\\"font-weight: 600;\\\">OCD:</span>&nbsp;الأفعال القهرية هي استجابة للأفكار الوسواسية القهرية لتقليل القلق.</li><li><span style=\\\"font-weight: 600;\\\">OCPD:</span>&nbsp;السلوكيات هي تعبير عن شخصية الفرد، وليست استجابة للقلق الوسواسي.</li></ul></li><li><p><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">الوعي بالمشكلة:</font></span></p><ul><li><span style=\\\"font-weight: 600;\\\">OCD:</span>&nbsp;الأشخاص غالبًا ما يكونون على وعي بأن الأفكار والسلوكيات الوسواسية غير منطقية ويمكن أن يشعروا بالإحباط أو الخجل منها.</li><li><span style=\\\"font-weight: 600;\\\">OCPD:</span>&nbsp;الأشخاص قد لا يدركون أن سلوكياتهم ومعاييرهم المفرطة في الدقة والكمال ليست طبيعية أو مشكلة، وقد يرون أنفسهم ببساطة كأشخاص منظمين للغاية ومكرسين لعملهم.</li></ul></li><li><p><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">التأثير على الحياة اليومية:</font></span></p><ul><li><span style=\\\"font-weight: 600;\\\">OCD:</span>&nbsp;السلوكيات القهرية تستهلك وقتًا كبيرًا ويمكن أن تعيق الأداء اليومي والعلاقات.</li><li><span style=\\\"font-weight: 600;\\\">OCPD:</span>&nbsp;السلوكيات والمواقف قد تسبب صراعات في العلاقات الشخصية أو في العمل، لكن الأشخاص يمكن أن يظلوا منتجين في بعض الحالات، خصوصًا في بيئات تقدّر الدقة والتفاني.</li></ul></li><li><p><span style=\\\"font-weight: 600;\\\"><font color=\\\"#003163\\\">المرونة والمعايير:</font></span></p><ul><li><span style=\\\"font-weight: 600;\\\">OCD:</span>&nbsp;الأفعال القهرية تُنفّذ لتجنب نتائج سلبية متوقعة، ويمكن أن تكون مرنة بحيث تتغير القهريات بناءً على الوسواس الحالي.</li><li><span style=\\\"font-weight: 600;\\\">OCPD:</span>&nbsp;يميل الأشخاص إلى التمسك بمعايير صارمة وقواعد ثابتة، حتى لو كانت هذه المعايير غير عملية أو تسبب صعوبات.</li></ul></li></ol><h3><font color=\\\"#003163\\\"><span style=\\\"font-weight: 600;\\\">طرق العلاج</span></font></h3><ul><li><span style=\\\"font-weight: 600;\\\">OCD:</span>&nbsp;العلاج يشمل غالبًا العلاج السلوكي المعرفي، وخاصة العلاج بالتعرض ومنع الاستجابة، وقد يشمل أيضًا الأدوية مثل مثبطات استرداد السيروتونين الانتقائية.</li><li><span style=\\\"font-weight: 600;\\\">OCPD:</span>&nbsp;العلاج قد يتضمن العلاج النفسي، بما في ذلك العلاج السلوكي المعرفي، لمساعدة الأشخاص على فهم وتعديل معاييرهم المرتفعة وتحسين مهارات التواصل والمرونة.</li></ul><p>في الختام، بينما يشترك اضطراب الوسواس القهري واضطراب الشخصية الوسواسية في بعض الخصائص السطحية، إلا أنهما يختلفان بشكل كبير في الأسباب، الأعراض، وطرق العلاج. الفهم الدقيق لهذه الاختلافات أساسي لتوجيه الأشخاص نحو الدعم والعلاج المناسبين.</p>\",\"trending\":0,\"original_trending\":null,\"image\":\" \",\"is_bookmark\":null,\"created_at\":\"2024-08-03T17:39:31.000Z\"}",
