    "message": "{\"id\":8,\"article_category\":null,\"keywords\":null,\"title\":\"الغذاء الصحي.. علاقة وثيقة بتحسين الصحة النفسية\",\"description\":\"<div>الغذاء الصحي.. علاقة وثيقة بتحسين الصحة النفسية</div><div>التغذية السليمة تلعب دورًا محوريًا في تعزيز الصحة العقلية، حيث يشكّل \\\"الطب النفسي الغذائي\\\" نهجًا مبتكرًا يقدم الأمل في الوقاية من اضطرابات الصحة العقلية وعلاجها بتحسين العادات الغذائية.</div><div><br></div><div>أظهرت الأبحاث أهمية النظام الغذائي المتكون من الفواكه، الخضروات، الأسماك، الحبوب الكاملة، وزيت الزيتون. يُلاحظ أن مرضى السكري، الذين يتأثرون بشكل كبير بنوعية غذائهم، يعانون من معدلات أعلى للاكتئاب والقلق. وُجد أيضًا أن أولئك الذين خضعوا لأنظمة غذائية صحية قد تحسنت حالتهم من الاكتئاب الشديد بأربعة أضعاف مقارنة بمن حصلوا على دعم اجتماعي فقط.</div><div><br></div><div>من جانب آخر، نقل ميكروبيوتا أمعاء الأشخاص المصابين بالاكتئاب إلى فئران التجارب أثار مؤشرات الاكتئاب والقلق فيها، مما يدل على دور ميكروبيوتا الأمعاء في تأثيرها على الصحة العقلية. النظم الغذائية الفعالة في الوقاية أو علاج اضطرابات الصحة العقلية غالبًا ما تكون غنية بالفواكه، الخضروات، الألياف، والحبوب الكاملة. على الرغم من أهمية اتباع نظم غذائية خاصة لأمراض معينة كأمراض القلب والسكري، لا يُعتمد هذا الأسلوب كثيرًا في علاج اضطرابات الصحة العقلية.</div>\",\"trending\":0,\"original_trending\":null,\"image\":\" \",\"is_bookmark\":null,\"created_at\":\"2024-03-13T21:42:52.000Z\"}",
