    "message": "{\"id\":4,\"title\":\"مقياس الوسواس القهرى \",\"color\":\"#FEB603\",\"icon\":\"https://talbinahtest.s3.eu-central-1.amazonaws.com/MentalAssessment/obsessive-compulsive.png\",\"question_number\":10,\"duration\":3,\"answer_type\":\"word\",\"total_grade\":40,\"reference\":\"الاستبيان الصحي في عينة سعودية. آن جين الطب النفسي\",\"brief\":\"يشكل هذا الاستبيان جزءا مهما من عملية تقديم افضل رعاية صحية ممكننة لك وستساعد اجابتك فى فهم المشكلات التى قد تعانى منها الرجاء الاجابه عن كل سؤال ب اكبر قدر من الصراحه\",\"usage_count\":108,\"created_at\":\"2024-02-22T04:23:42.000000Z\",\"updated_at\":\"2025-06-15T12:36:59.000000Z\"}",
